import React from 'react';
import styles from '../header/header.module.css'
import { findByLabelText } from '@testing-library/react';
class Header extends React.Component {


    render () {

        const navRightSide = {
            color: "red",
            marginLeft: "auto",
            float: "right",
            verticleAlign: "center",
            display: "flex",
            flexDirection: "row"
        };

        const verticleCenterMenuOptions = {
            lineHeight: "5rem",
            textAlign: "center",
            verticleAlign: "center"
        };

        const pStyle = {
            marginBottom: "0px",
            marginLeft: "3em"

        };

        var Logo = () => {
            return (
                <a><img src="imgs/git.png" className={styles.logo}></img></a>
            );
        };

        var LeftSideTopNav = () => {
            return ( 
            <div className="col-3" style={verticleCenterMenuOptions}>
                <div className={styles.LogoWrapper}>
                    <Logo/>
                </div>
            </div>
            );
        };

        var RightSideTopNav = () => {
            return (
                <div className="container">
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <a className="navbar-brand" href="#">Navbar</a>
                </nav>
                </div>
            );
        }

        return (
            <div className={styles.headerOuter}>
                <div className="container">
                    <div className="row" >
                            <LeftSideTopNav/>
                            <RightSideTopNav/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
